import { Link } from "react-router-dom";
import classes from "./Header.module.css"

const Header = () =>
{
    return(
        <div className={classes.header}>
            <Link to="/home" className={classes.textInHeader}>EduSchedule</Link>
            <Link to="/help" className={classes.text}>Помощь</Link>
            <Link to="/events" className={classes.text}>События</Link>
            <Link to="/marks" className={classes.text}>Отметки</Link>
            <Link to="/schedule" className={classes.text}>Расписание</Link>
        </div>
    )
}

export default Header;
